import './ExpenseItem.css'

function ExpenseItem() {
  const expenseDate = "03/01/2021";
  const purchaseAmount = "143.52";
  const rewardPoints = 72;

  return (
    <div className="expense-item">
      <div>{expenseDate}</div>
      <div className="expense-item__amount">
        <h2>{$ + purchaseAmount}</h2>
        </div>
      <div className="expense-item__points">{rewardPoints}</div>
    </div>
  );
}

export default ExpenseItem;
